    false,nt"url": null,nt"notes": "This narrative report details the conditions
    and management of Stillwater Wildlife Management Area from January through April
    of 1949.  The report begins with general information about weather and water conditions
    on the refuge and planned burns.  The second section of the report describes wildlife
    on the refuge and includes migratory birds, upland game birds, big game animals,
    fur animals, predaceous birds, and fish.  The report then covers the refugeu2019s
    development and maintenance projects.  The fourth section of the report includes
    information about economic use of the refuge and includes grazing and fur harvesting.
     The last section of the report describes public relations; a list of refuge visitors
    is provided.  Finally, N-R forms are provided.",nt"license_title": "License
